import React,{Component} from 'react';
import "semantic-ui-css/semantic.min.css";
import{
  Grid,
  Form,
  Table,
  Search,
  Label
}from "semantic-ui-react";

class App extends Component {
  render(){
    return (
      <div>
        <br />
        <Grid Content columns={2}>
          <Grid.Colomn width={2}>
          </Grid.Colomn>
          <Grid.Colomn width={13}>
            <Form>
              <Table celled>
                <Table.Header>
                  <Table.Row>
                    <Table.HeaderCell colSpan="2">
                      <Search aligned="right" placeholder="Seacrh document"/>
                    </Table.HeaderCell>
                  </Table.Row>
                </Table.Header>

                <Table.Header>
                  <Table.Row>
                    <Table.HeaderCell textAlign="center">Nama Document</Table.HeaderCell>
                    <Table.HeaderCell textAlign="center">Jenis File</Table.HeaderCell>
                  </Table.Row>
                </Table.Header>
              </Table>
            </Form>
          </Grid.Colomn>
        </Grid>
      </div>
    );
  }
}

export default App;
